import React from 'react';
const Header = ({ toggleDarkMode, darkMode }) => (
  <div className="bg-white dark:bg-gray-800 p-4 rounded shadow-md flex justify-between items-center">
    <h1 className="text-2xl font-bold text-gray-800 dark:text-white">Trading Dashboard</h1>
    <button onClick={toggleDarkMode} className="bg-gray-200 dark:bg-gray-700 text-black dark:text-white px-4 py-2 rounded">
      {darkMode ? 'Light Mode' : 'Dark Mode'}
    </button>
  </div>);
export default Header;
